      out.write("    function updateCartCountFromCookie(userId, productCount) {\r\n");
      out.write("        let count = 0;\r\n");
      out.write("\r\n");
      out.write("        if (userId !== \"null\" && userId !== \"\") {\r\n");
      out.write("            count = productCount;\r\n");
      out.write("        } else {\r\n");
